import React from 'react';
import logo from './logo.svg';
import './App.css';
import Dashboard from './dashboard';
import Balaji from './balaji';
import Head from './head';
import Sam from './sam';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Head />
        <Dashboard />
        <Sam/>

       <Balaji/>

      </header>

    </div>
  );
}

export default App;
